            {course.map(a => {
                <Part name={a.name} exercises={a.exercises}/>
            })}
            {course.map(a => {
                return (
                    <div>
                        {a.name} {a.exercises}
                    </div>
                )
        })}
        </div>
    )
}

export default Content
